	end

	if (event == "G_PRESSED" and arg == 8) then
		ExecuteBind(G8)
	end

	if (event == "G_PRESSED" and arg == 9) then
		ExecuteBind(G9)
	end

	if (event == "G_PRESSED" and arg == 10) then
		ExecuteBind(G10)
	end

	if (event == "G_PRESSED" and arg == 11) then
		ExecuteBind(G11)
	end

	if (event == "G_PRESSED" and arg == 12) then
