	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 3) then
		if alt_down then
			ExecuteBind(MB3_ALT)
		else
			ExecuteBind(MB3)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
		if alt_down then
			ExecuteBind(MB4_ALT)
		else
			ExecuteBind(MB4)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
		if alt_down then
			ExecuteBind(MB5_ALT)
		else
			ExecuteBind(MB5)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 6) then
		if alt_down then
			ExecuteBind(MB6_ALT)
		else
			ExecuteBind(MB6)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 7) then
		if alt_down then
			ExecuteBind(MB7_ALT)
		else
			ExecuteBind(MB7)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 8) then
		if alt_down then
			ExecuteBind(MB8_ALT)
		else
			ExecuteBind(MB8)
		end
	end
end

function OnEvent(event, arg)
	--OutputLogMessage("event: %s, arg: %s\n", event, arg)

	local start_ms = GetRunningTime()

	local weapon_option = weapon_options[selected_weapon]

	-- fire script on main mouse button
	if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then
		FullAutoRecoil(start_ms, weapon_option)
	elseif (event == "PROFILE_ACTIVATED") then
    	-- enable trigger onevent when mb1 is pressed
        EnablePrimaryMouseButtonEvents(true)
        print_info()
    else
		BindMapping(event, arg)
    end 

    if show_pressed_mouse_button then
    	OutputLogMessage("Pressed mouse button: %d\n", arg)
    end
end

function print_info() 
	OutputLogMessage("\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n")
	mode = "unreal"
	if(legit) then
		mode = "legit"
	end

	OutputLogMessage("Weapon: %s, Hipfire: %s, Mode: %s, Activated: %s\n", weapon_options[selected_weapon][1], tostring(hipfire), mode, tostring(activated))

    OutputLogMessage("Attachments:\n")
	for index, attachment in ipairs(selected_attachments) do
		OutputLogMessage("-%s\n", attachment)
	end
end

function closest_int(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end

